const figmaReducer = (state = initialState_v1, action) => {
    // console.log("web reducer ===>", action);

    switch (action.type) {
        case "SET_TOKEN_AND_FILEID":
            return {
                token: action.data.token,
                fileId: action.data.fileId,
                property: state.property,
                fileName: state.fileName,
                url: state.url,
                selectedPageFrame: state.selectedPageFrame
            }
        case "SET_PROP":
            return {
                token: state.token,
                fileId: state.fileId,
                property: action.data.property,
                fileName: action.data.fileName,
                url: state.url,
                selectedPageFrame: state.selectedPageFrame
            }
        case "SET_HOST_AND_FRAME":
            return {
                token: state.token,
                fileId: state.fileId,
                property: state.property,
                fileName: state.fileName,
                url: action.data.url,
                selectedPageFrame: action.data.selectedPageFrame
            }
        case "RESET_FIGMA_PROP":
            return {
                token: '',
                fileId: '',
                property: {},
                fileName: '',
                url: '',
                selectedPageFrame: ''
            };
        default:
            return state;
    }
};

export default figmaReducer;
